import React from "react";

function Home(){
    return(
        <div className="homeButtonContainer">
            <h1 className="homeTitle">Welcome to all things space!!! Come and learn about launches, spaces and astronauts.</h1>
            <div className="rocketGifDiv">
                <img className="rocketGif" src="https://i.makeagif.com/media/8-05-2016/H6228b.gif" alt="rocket launch" />
            </div>
        </div>
    )
}

export default Home
